import React from 'react';

const Nav = ({libraryStatus, setLibraryStatus}) => {
  return (
    <nav>
      <h1>Music Player</h1>
      <button 
      onClick={() => {setLibraryStatus(!libraryStatus)}}>
        <h4>Library</h4>
      </button>
    </nav>
  );
};

export default Nav;
